import React from 'react';
import {BrowserRouter, BrowserRouter as Router, Link, Route, Routes} from 'react-router-dom';
import VizNavigation from './routes/VizNavigation';
import routes from './routes/Routes';
import 'bootstrap/dist/css/bootstrap.min.css';
import { LocationProvider } from "react-router-dom";
import ExamplePage from "./toy_examples/ExamplePage";
import Root from "./routes/Root";
const App = () => {
  return (
      <div>
          <BrowserRouter>
              <Routes>
                  <Route path="/" element={<Root/>}/>
                  <Route path="cats-example" element={<ExamplePage/>}/>
              </Routes>
              <App/>
          </BrowserRouter>

      </div>
  );
};
export default App;
